import React from 'react';
import PropTypes from 'prop-types';
import { useState } from 'react';

const data = [
  {a:1,b:2,c:3},
  {a:"c",b:"v",c:"j"},
  
];

const Testa = (props) => {
  const { tit, name, mess } = props;
  const [status , setTus] = useState("Start");
  data.map(arr=>{
    console.log(arr);
    return (
      <div className="taskItem">
  
    
      <label> Title {data.a} </label><br></br>
      <label> Creator {name}</label><br></br>
      <label> Status {status}</label><br></br>
      <p>
        Desscription: {mess} <br />
      </p>
      <button onClick={()=>setTus("Done")}></button>
      <button onClick={()=>setTus("Doning")}></button>
    </div>
    )
  })
  

  
};
Testa.propTypes = {

}
Testa.defaultProps = {
  tit : "title 1",
  name : "name",
  status : "status 1",
  mess : "messs",
}



export default Testa;
